import React from "react";
import { NavLink as RouterNavLink, Link } from "react-router-dom";
import Jumbotron from "../../components/Jumbotron";

import { NavLink } from "reactstrap";

const Home = () => (
  <>
    <Jumbotron />
    <NavLink
      tag={RouterNavLink}
      to="/profile"
      exact
      activeClassName="router-link-exact-active"
    >
      Sign Up
    </NavLink>
    <hr />
  </>
);

export default Home;
